import React from 'react';
import styled from 'styled-components';

const Score = () => {

 const ScoreWrapper = styled.div`
 height:120px;
 width:180px;
 border: solid;
 border-color:white;
 border-radius: 1rem;
 align-self:center;
 justify-self:right;
 margin-right:50px;
 background-color:WhiteSmoke;
 `
 return (
  <ScoreWrapper>
    <h1>Score</h1>
  </ScoreWrapper>
 )
}

export default Score
